import React from "react";

function Contact(props)
{
    return (

        <div className="" >
            <h2 className = "name">{props.name}</h2>
            <img className="circle-img"
            src= {props.img}
            alt="avatar_img"
            />
            <div className="info">
            <p>{props.tel}</p>
            <p>{props.email}</p>
            </div>
            
        </div>
    )
}
export default Contact;
